import React, { useState, useCallback } from "react";

// Icons as reusable components
const Icons = {
  Home: () => (
    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <path d="M3 9l9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"></path>
      <polyline points="9 22 9 12 15 12 15 22"></polyline>
    </svg>
  ),
  Search: () => (
    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <circle cx="11" cy="11" r="8"></circle>
      <line x1="21" y1="21" x2="16.65" y2="16.65"></line>
    </svg>
  ),
  Globe: () => (
    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <circle cx="12" cy="12" r="10"></circle>
      <line x1="2" y1="12" x2="22" y2="12"></line>
      <path d="M12 2a15.3 15.3 0 0 1 4 10 15.3 15.3 0 0 1-4 10 15.3 15.3 0 0 1-4-10 15.3 15.3 0 0 1 4-10z"></path>
    </svg>
  ),
  Users: () => (
    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
      <path d="M17 21v-2a4 4 0 0 0-4-4H5a4 4 0 0 0-4 4v2"></path>
      <circle cx="9" cy="7" r="4"></circle>
      <path d="M23 21v-2a4 4 0 0 0-3-3.87"></path>
      <path d="M16 3.13a4 4 0 0 1 0 7.75"></path>
    </svg>
  )
};

const Navigation = () => {
  const [isUserMenuOpen, setIsUserMenuOpen] = useState(false);

  const handleClickOutside = useCallback((e) => {
    if (!e.target.closest(".user-menu-wrapper")) {
      setIsUserMenuOpen(false);
    }
  }, []);

  React.useEffect(() => {
    document.addEventListener("click", handleClickOutside);
    return () => document.removeEventListener("click", handleClickOutside);
  }, [handleClickOutside]);

  const sideNavItems = [
    { icon: Icons.Home, label: "Home", path: "/" },
    { icon: Icons.Search, label: "Search", path: "/search" },
    { icon: Icons.Globe, label: "Explore", path: "/explore" },
    { icon: Icons.Users, label: "Community", path: "/community" }
  ];

  const userMenuItems = [
    { icon: Icons.Users, label: "Profile", path: "/profile" },
    { icon: Icons.Search, label: "Help", path: "/help" }
  ];

  return (
    <div className="navigation">
      <nav className="side-nav">
        <ul>
          {sideNavItems.map((item, index) => (
            <li key={index}>
              <a href={item.path} className="nav-item">
                <item.icon />
                <span>{item.label}</span>
              </a>
            </li>
          ))}
        </ul>
      </nav>

      <div className="user-menu-wrapper">
        <button
          className="user-menu-toggle"
          onClick={() => setIsUserMenuOpen(!isUserMenuOpen)}
        >
          <Icons.Users />
        </button>
        {isUserMenuOpen && (
          <div className="user-menu">
            <ul>
              {userMenuItems.map((item, index) => (
                <li key={index}>
                  <a href={item.path} className="menu-item">
                    <item.icon />
                    <span>{item.label}</span>
                  </a>
                </li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
};

export default Navigation;
